import React from 'react';

import './Facing.css';

const Facing = (props) => {
  const name = props.product.toLocaleString('en-US', { name: 'long' });
  const upc = props.product.toLocaleString('en-US', { upc: '2-digit' });
  const percentage = props.product.getFullYear();

  return (
    <div className='facing-product'>
      <div className='facing-product__name'>{name}</div>
      <div className='facing-product__upc'>{upc}</div>
      <div className='facing-product__percentage'>{percentage}</div>
    </div>
  );
};

export default Facing;
